import React from "react";
import styles from "./styles.module.css";

const DataTable = () => {
  return (
    <div className={styles.tableContainer}>
      <label className={styles.heading}>Projects</label>
      <table border={1}>
        <th className={styles.projectName}>Project Name</th>
        <th className={styles.startDate}> Start Date</th>
        <th className={styles.dueDate}>Due Date</th>
        <th className={styles.team}>Team</th>
        <th className={styles.status}>Status</th>
        <th className={styles.client}>Client</th>
        {/* </div> */}
      </table>
    </div>
  );
};
export default DataTable;
